import React from 'react'
import * as LottiePlayer from "@lottiefiles/lottie-player";

function Lottie_section() {
    return (
        <div><lottie-player
            autoplay
            controls
            loop
            mode="normal"
            src="../../assets/animation1.json"
            style={{width: "320px"}}>
        </lottie-player></div>
    )
}

export default Lottie_section
